Jack Kirby's unresolved cosmic saga, The Eternals, was highly influential within the Marvel universe and community, but unappreciated in its time (as was much of Kirby's work, sadly, including his similar New Gods for DC). This torrent collects the entire body of work, now know as volume one - issues 01-19 and the Annual. These are presented in digital format, thanks to an unknown scanner group as no credit was listed from the source. Please seed, and enjoy these classics! :-)
